import React from "react";

import './ProductSlide.css'

const ProductSlide = () => {
    return (
        <div className="product__slide">
            <span>슬라이드가 들어갈 자리입니다~!</span>
            {dummySool.map((sool) => <ProductCard key={sool.id} sool={sool}/>)}
        </div>
    )
}

export default ProductSlide;
